description:
Taking place 500 years in the future, the game tells the story of Lu Chen, a sinister world overlord more commonly known as the SovKhan, who rules the Earth from a massive complex called Megacity S1-9. 

This is a 3rd person shooter, you are a giant robot who shoots the hell outa the bad guys; pretty simple, and fun to play. 

Xpadder with profiles for Xbox360 and PS3 gamepads.

Compressed with 7zip and scanned with Comodo IS.

